Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  ?x ns:location.country.official_language ns:m.06nm1 . # Spanish language
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
	{ 
	  ns:m.01_x6v ns:tv.tv_actor.starring_roles ?y .
	  ?y ns:tv.regular_tv_appearance.character ?x ;
	     ns:tv.regular_tv_appearance.special_performance_type ns:m.02nsjvf .
	}
	UNION
	{ 
	  ns:m.01_x6v ns:film.actor.film ?y .
	  ?y ns:film.performance.character ?x ;
	     ns:film.performance.special_performance_type ns:m.02nsjvf .
	}
}
